import React from 'react';

function Tutorial() {
    return(
        <div style={{position: 'relative', paddingBottom: '56.25%', height: '0'}}>
        <iframe title="Tutorial Video" style={{position: 'absolute', top: '0', left: '0', width: '100%', height: '100%'}} src="https://www.youtube.com/embed/k4NTf0hMjtY" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
      </div>
    );
}

export default Tutorial
